import {AuthService} from "./services/auth/"



@NgModule({
  declarations: [
    NotFoundComponent,
    LogoComponent,
    HeaderComponent,
    SidebarComponent

  ],
  imports: [
    CommonModule,
    MaterialModule
  ],
  exports:[
    NotFoundComponent,
    LogoComponent,
    HeaderComponent,
    SidebarComponent,
    AuthService
  ]
})
export class SharedModule { }
